function sortStartDate(){for(var t,n,f,e,r,u=document.getElementById("table"),i=!0;i;){for(i=!1,t=u.rows,n=1;n<t.length-1;n++)if(r=!1,f=t[n].getElementsByTagName("TD")[2],e=t[n+1].getElementsByTagName("TD")[2],Date(f.innerHTML)>Date(e.innerHTML)){r=!0;break}r&&(t[n].parentNode.insertBefore(t[n+1],t[n]),i=!0)}}function sortEndDate(){for(var t,n,f,e,r,u=document.getElementById("table"),i=!0;i;){for(i=!1,t=u.rows,n=1;n<t.length-1;n++)if(r=!1,f=t[n].getElementsByTagName("TD")[3],e=t[n+1].getElementsByTagName("TD")[3],Date(f.innerHTML)>Date(e.innerHTML)){r=!0;break}r&&(t[n].parentNode.insertBefore(t[n+1],t[n]),i=!0)}}